          <img
            src="https://m.media-amazon.com/images/I/61HxIbHP6AL._AC_SY400_.jpg"
            alt=""
          />
        </div>
        <div>
          <img
            src="https://m.media-amazon.com/images/I/61HxIbHP6AL._AC_SY400_.jpg"
            alt=""
          />
        </div>
      </Carousel>
    </div>
  );
};

export default MultiCarousel;
